import React from 'react';
import { NavLink } from 'react-router-dom';
import s from './Nav.module.css';
import Sidebar from "../Sidebar/Sidebar";



type FriendType = {
  name: string
  id: number
  img: string
}
export type SidebarType = {
  friends: Array<FriendType>
}

const Nav = (props: SidebarType) => {

  let FriendsElement = props.friends.map((p: {id: number, name: string, img: string}) => <Sidebar id={p.id} name={p.name} img={p.img} />)
    return (
      <nav className={s.nav}>
      <div className = {s.item}>
      <NavLink to = '/Profil' activeClassName = {s.active}>Profile</NavLink>
      </div>
      <div className = {s.item}>
        <NavLink to = '/Dialogs' activeClassName = {s.active}>Messeges</NavLink>
      </div>
      <div className = {s.item}>
      <NavLink to = '/News' activeClassName = {s.active}>News</NavLink>
      </div>
      <div className = {s.item}>
      <NavLink to = '/Music' activeClassName = {s.active}>Music</NavLink>
      </div>
      <div className = {s.item}>
      <NavLink to = '/Settings' activeClassName = {s.active}>Settings</NavLink>
      </div>
        <div>
          <NavLink to = '/Friends' activeClassName = {s.active}><h3>FRIENDS</h3></NavLink>
        </div>
        <div>{FriendsElement}</div>
    </nav>
    )
}

export default Nav
